import { Container, Navbar } from "react-bootstrap"
import 'bootstrap/dist/css/bootstrap.min.css';

export const Dashboard = () => {
    return (
        <div className="home">
            <Navbar bg="dark" variant="dark">
                <Container>
                <Navbar.Brand href="#home">
                    React Bootstrap
                </Navbar.Brand>
                </Container>
            </Navbar>
        </div>

    )
}
